0Z","ownerAvatar":"https://avatars.githubusercontent.com/u/6702762?v=4","public":true,"private":false,"isOrgOwned":false},"symbolsExpanded":false,"treeExpanded":true,"refInfo":{"name":"master","listCacheKey":"v0:1690020046.0","canEdit":false,"refType":"branch","currentOid":"11f92e098bf70d694c0389a40ee89cdafd89e4f3"},"path":"Misc/EnableSeRestorePrivilege.ps1","currentUser":null,"blob":{"rawLines":["function Enable-SeRestorePrivilege {","<#",".SYNOPSIS","    ","\tEnables SeRestorePrivilege for the current (powershell/ise) process.","\tIt allows you to overwrite ACL-protected files using the same console.","","\tYou have to have the privilege in your token first - check it with \"whoami /priv\" if not sure.","\t","\tThe full scenario for taking admin rights is described at https://github.com/gtworek/Priv2Admin under \"SeRestore\" section.","    ",".DESCRIPTION","\tAuthor: Grzegorz Tworek","\tRequired Dependencies: None","\tOptional Dependencies: None","\t    ",".EXAMPLE","\tC:\\PS> Enable-SeRestorePrivilege","#>","","\t# API Calls interface for: OpenProcessToken, LookupPrivilegeValue, AdjustTokenPrivileges, GetLastError","\t# Structure definition for: TokPriv1Luid","","\tAdd-Type -TypeDefinition @\"","\tusing System;","\tusing System.Diagnostics;","\tusing System.Runtime.InteropServices;","\tusing System.Security.Principal;","\t","\t[StructLayout(LayoutKind.Sequential, Pack = 1)]","\tpublic struct TokPriv1Luid","\t{","\t\tpublic int Count;","\t\tpublic long Luid;","\t\tpublic int Attr;","\t}","\t","\tpublic static class Advapi32","\t{","\t\t[DllImport(\"advapi32.dll\", SetLastError=true)]","\t\tpublic static extern bool OpenProcessToken(","\t\t\tIntPtr ProcessHandle, ","\t\t\tint DesiredAccess,","\t\t\tref IntPtr TokenHandle);","\t\t\t","\t\t[DllImport(\"advapi32.dll\", SetLastError=true)]","\t\tpublic static extern bool LookupPrivilegeValue(","\t\t\tstring lpSystemName,","\t\t\tstring lpName,","\t\t\tref long lpLuid);","\t\t\t","\t\t[DllImport(\"advapi32.dll\", SetLastError = true)]","\t\tpublic static extern bool AdjustTokenPrivileges(","\t\t\tIntPtr TokenHandle,","\t\t\tbool DisableAllPrivileges,","\t\t\tref TokPriv1Luid NewState,","\t\t\tint BufferLength,","\t\t\tIntPtr PreviousState,","\t\t\tIntPtr ReturnLength);","\t\t\t","\t}","\t","\tpublic static class Kernel32","\t{","\t\t[DllImport(\"kernel32.dll\")]","\t\tpublic static extern uint GetLastError();","\t}","\"@","\t","\t# Get current process (powershell) handle","\t$ProcHandle = (Get-Process -Id ([System.Diagnostics.Process]::GetCurrentProcess().Id)).Handle","\tWrite-Debug \"Current process handle: $ProcHandle\"","\t\t","\t# Open token handle with TOKEN_ADJUST_PRIVILEGES | TOKEN_QUERY","\tWrite-Debug \"Calling OpenProcessToken()\"","\t$hTokenHandle = [IntPtr]::Zero","\t$CallResult = [Advapi32]::OpenProcessToken($ProcHandle, 0x28, [ref]$hTokenHandle)","\tWrite-Debug \"Token handle: $hTokenHandle\"","\t\t","\t# Prepare TokPriv1Luid container","\t$TokPriv1Luid = New-Object TokPriv1Luid","\t$TokPriv1Luid.Count = 1","\t$TokPriv1Luid.Attr = 0x00000002 # SE_PRIVILEGE_ENABLED","\t\t\t","\t# Get SeRestorePrivilege luid","\t$LuidVal = $Null","\tWrite-Debug \"Calling LookupPrivilegeValue for SeRestorePrivilege\"","\t$CallResult = [Advapi32]::LookupPrivilegeValue($null, \"SeRestorePrivilege\", [ref]$LuidVal)","\tWrite-Debug \"SeRestorePrivilege LUID value: $LuidVal\"","\t$TokPriv1Luid.Luid = $LuidVal","\t\t\t","\t# Enable SeRestorePrivilege for the current process","\tWrite-Debug \"Calling AdjustTokenPrivileges\"","\t$CallResult = [Advapi32]::AdjustTokenPrivileges($hTokenHandle, $False, [ref]$TokPriv1Luid, 0, [IntPtr]::Zero, [IntPtr]::Zero)","\t$LastError = [Kernel32]::GetLastError()","\tWrite-Debug \"GetLastError returned: $LastError\"","    #0 - OK.","    #6 - one of previous steps failed. Observe the output for handles equal to 0 or just re-run entire script.","    #1300 - privilege not held","","}","","","$DebugPreference = \"Continue\"","Enable-SeRestorePrivilege"],"stylingDire